import React from 'react';
import Login from './Login';
import Register from './Register'
import Home from './Home';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';
import '../css/app.css';

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/signup"/>

          <Register/>
        <Route exact path="/">
          <Login/>
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
